import React from 'react';
import { Row, Image, Col } from "react-bootstrap";
import profile from '../../assets/images/weliton-profile.jpg'

const Home = () => {
	return (
		<div>
			<Row>
				<Col xs={6} md={4}>
					<div>
						<Image src={profile} roundedCircle style={{width: '50%'}}/>
					</div>
				</Col>
				<Col xs={6} md={8}>
				</Col>
			</Row>
		</div>
	)
}
	export {Home};
